import './App.css';

const Person = (props) => {
return (
  <>
  <h1>Name: {props.name}</h1>
  <h2>Last Name: {props.lastName}</h2>
  <h2>Age: {props.age}</h2>
  </>
)
}

const App = () => {




  return (
    <div className="App">
    <Person name="Schwanz" lastName='Doe' age={7/3} />
    <Person name={'Anita'}/>

    </div>
  );
}

export default App;
